import Dashboard from "views/Dashboard.js";
import Automacoes from "views/Automacoes.js";
import Home from "views/Home.js";
import Notifications from "views/Notifications.js";
import TableList from "views/TableList.js";
import UserProfile from "views/UserProfile.js";
import Login from "views/Login";
import Register from "views/Register";

var routes = [
  {
    path: "/Home",
    name: "Home",
    icon: "tim-icons icon-atom",
    component: Home,
    layout: "/admin",
  },
  {
    path: "/Automacoes",
    name: "Produtos",
    icon: "tim-icons icon-atom",
    component: Automacoes,
    layout: "/admin",
  },
  {
    path: "/notifications",
    name: "Categorias",
    icon: "tim-icons icon-bell-55",
    component: Notifications,
    layout: "/admin",
  },
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "tim-icons icon-chart-pie-36",
    component: Dashboard,
    layout: "/admin",
  },
  {
    path: "/tables",
    name: "Banco de dados",
    icon: "tim-icons icon-puzzle-10",
    component: TableList,
    layout: "/admin",
  },
  {
    path: "/user-profile",
    name: "Conta",
    icon: "tim-icons icon-single-02",
    component: UserProfile,
    layout: "/admin",
  },
  {
    path: "/login",
    name: "Login",
    icon: "tim-icons icon-chart-pie-36",
    component: Login,
    layout: "/auth",
  },
  {
    path: "/register",
    name: "Registrar",
    component: Register,
    layout: "/admin",
  },
  {
    path: "/register",
    name: "Registrar",
    component: Register,
    layout: "/auth",
  },
];
export default routes;
